import { ReactDOM } from 'react-dom';

class File extends Component{
    method(){
        return(
            <h1>
                Alazab
            </h1>
        )
    }
    render(){
        const name="Basem"
        const name2=this.method()
      return(
          
          <h1>{name} {name2}</h1>
              )
    }
  }
  export default File;
